    [],nt"revision_timestamp": "2016-07-27T23:06:32.697845",nt"name": "national-wildlife-refuges-potential-research-sites",nt"isopen":
    false,nt"url": null,nt"notes": "This binder has been prepared to provide
    information on individual refuge management issues, and questions that require management-oriented
    research. Students, faculty, USGS scientists, and others can use this information
    to identify where their interests and expertise match with the needs of refuges.
    Each "fact sheet" contains a short background on the refuge, a list of key issues,
    species, and habitats, as well as, a set of high priority questions, opportunities,
    and contacts. More information on each refuge can be found on their website, or
    by contacting the refuge manager.",nt"license_title": "License Not Specified",nt"extras":
